import React,{ Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Typical from 'react-typical'

function App() {
  return (
    <div className="App">
    <Typical
        steps={['Summer Bakr. Aspiring software developer, with a love for all things tech.', 500]}
        loop={Infinity}
        wrapper="p"
      />
    </div>
  );
}

export default App;
